- pipeline: "Build to deploy"
  trigger_mode: "ON_EVERY_PUSH"
  ref_name: "features/buddy"
  ref_type: "BRANCH"
  trigger_condition: "ALWAYS"
  actions:
  - action: "Setup gcloud"
    type: "BUILD"
    working_directory: "/buddy/rxinvoice"
    docker_image_name: "google/cloud-sdk"
    docker_image_tag: "alpine"
    execute_commands:
    - "echo \"$GCP_SERVICE_KEY\" > /tmp/credentials.json"
    - "gcloud auth activate-service-account --key-file=\"/tmp/credentials.json\""
    - "gcloud config set disable_prompts true"
    - "gcloud config set project $GCP_PROJECT_ID"
    - "gcloud auth configure-docker -q"
    - "gcloud container clusters get-credentials quatreapp-cl --zone=europe-west1-c"
    - "kubectl config set-context --current --namespace=4sh-invoice-dev"
    setup_commands:
    - "gcloud components install kubectl"
    mount_filesystem_path: "/buddy/rxinvoice"
    shell: "BASH"
    trigger_condition: "ALWAYS"
  - action: "Execute: mvn -B package"
    type: "BUILD"
    working_directory: "/buddy/rxinvoice"
    docker_image_name: "zbbfufu/mvn-npm-builder"
    docker_image_tag: "3.6-9.11"
    execute_commands:
    - "mvn -B package"
    cached_dirs:
    - "/root/.m2/repository"
    - "/root/.npm"
    mount_filesystem_path: "/buddy/rxinvoice"
    shell: "BASH"
    trigger_condition: "ALWAYS"
    variables:
    - id: 304438
      key: "GCP_PROJECT_ID"
      value: "quatreapp"
      description: ""
    - id: 304439
      key: "GCP_SERVICE_KEY"
      value: "secure!.IkTcij7ZeQtUfwKbEY7NMw=="
      encrypted: true
      description: "credentials.json"
  - action: "Docker build push"
    type: "BUILD"
    disabled: true
    working_directory: "/buddy/rxinvoice"
    docker_image_name: "zbbfufu/docker-xmllint"
    docker_image_tag: "20200221-02"
    execute_commands:
    - "pushd srv/"
    - "./docker-build-push.sh"
    - "popd"
    cached_dirs:
    - "/var/lib/docker"
    mount_filesystem_path: "/buddy/rxinvoice"
    shell: "BASH"
    trigger_condition: "ALWAYS"
    variables:
    - id: 304443
      key: "GCP_PROJECT_ID"
      value: "quatreapp"
      description: ""
  - action: "Execute: mv srv/target/rxinvoice-*.war /srv/target/ROOT.war"
    type: "BUILD"
    working_directory: "/buddy/rxinvoice"
    docker_image_name: "library/ubuntu"
    docker_image_tag: "18.04"
    execute_commands:
    - "mv srv/target/rxinvoice-*.war srv/target/ROOT.war"
    mount_filesystem_path: "/buddy/rxinvoice"
    shell: "BASH"
    trigger_condition: "ALWAYS"
  - action: "Build Docker image"
    type: "DOCKERFILE"
    dockerfile_path: "srv/Dockerfile"
    context_path: "srv/"
    trigger_condition: "ALWAYS"
  - action: "Push Docker image"
    type: "DOCKER_PUSH"
    login: "_json_key"
    password: "secure!.AqE8lYqTOL21djtRSVHEvA=="
    docker_image_tag: "$BUDDY_EXECUTION_REVISION_SHORT,latest"
    repository: "quatreapp/rxinvoice-buddy"
    registry: "eu.gcr.io"
    trigger_condition: "ALWAYS"
  variables:
  - key: "CLOUDSDK_CONFIG"
    value: "/buddy/rxinvoice/.config/gcloud"
    id: 304455
    description: ""
  - key: "DOCKER_CONFIG"
    value: "/buddy/rxinvoice/.docker"
    id: 304467
    description: ""
  - key: "GCP_PROJECT_ID"
    value: "quatreapp"
    id: 304494
    description: ""
  - key: "GCP_SERVICE_KEY"
    value: "secure!.c+Xo8mZeAlJEhaRiJO9T7g=="
    id: 304493
    description: ""
